subSubSection.paragraph:
GNATHOSOMA (
Fig. 11F, G
). Cheliceral blade with tricuspid cap; cheliceral base with small dense puncta basally and more sparse puncta in distal part; gnathobase with small dense puncta, transverse striae, and 1 pair of branched gnathocoxal (tritorostral) setae; galeal (deutorostral) seta nude; palpal claw with 2 prongs, inner prong twice as short as outer prong and located medially on the latter; palpal femur with numerous puncta and branched seta; palpal genu with puncta and nude seta; palpal tibia with three nude setae; palpal tarsus with 7 branched setae, nude subterminala (
ζ
) and basal tarsala (
ω
).

LEGS (
Fig. 12
). All 7-segmented, with 1 pair of claws and claw-like empodium. Leg I: coxa with 1 branched seta (1B); trochanter 1B; basifemur 1B; telofemur 5B; genu 4B, 3 genualae (
σ
), microgenuala (
κ
); tibia 8B, 2 tibialae (
φ
), microtibiala (
κ
); tarsus 22B, tarsala (
ω
), microtarsala (
ε
) distal to tarsala, subterminala (
ζ
), parasubterminala (
z
), pretarsala (
ζ
). Leg II: coxa 1B; trochanter 1B; basifemur 2B; telofemur 4B; genu 3B, genuala; tibia 6B, 2 tibialae (
φ
); tarsus 16B, tarsala (
ω
), microtarsala (
ε
) proximal to tarsala, pretarsala (
ζ
). Leg III: coxa 1B; trochanter 1B; basifemur 2B; telofemur 3B; genu 3B, genuala; tibia 6B, tibiala; tarsus 14B, mastitarsala.

Distribution. Brazil , Bolivia , Colombia , Costa Rica , Dominica , Panama , Surinam , Trinidad , Venezuela (
Jacinavicius et al. 2018
;
Bassini-Silva et al. 2021
), and Peru (this study).
